import {
    Box,
    Text
} from '@chakra-ui/react';

function PostPreview() {
    return (
        <Box m={10} background="gray">

            <Box display="flex">
                <Text>Post Title</Text>
                <Text marginLeft="auto">Post Date</Text>
            </Box>

            <Box m={20}>
                <Text>Post Preview</Text>
            </Box>
        </Box>
    );
}

export default PostPreview;
